import './Home.css';
import React from 'react';
{/*images*/}
import ReactLogo from './logo.svg';

function Home(){
    return(



        



        <div className="main">

			<div className="container-index">
        
           <div className="poster">
            <h2>Welcome to Maharaja Kitchen</h2>
            <h2>Authentic Indian Food</h2>
            <div className="App">
      <img src={ReactLogo} alt="React Logo" />
    </div>
        
            <img src='/Images/vector.jpg' alt="Welcome to Maharaja Kitchen" />
            
            
                
            </div>
			
          </div>
					
					           
   
    
               

</div>





				
    
    
	        
	
    );
}

export default Home;
